        mHdltvoutHandle << " , " <<  " \"test_samples_data_ce1\" :  \"" << test_samples_data_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"test_samples_data_q1\" :  \"" << test_samples_data_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"train_samples_label_address0\" :  \"" << train_samples_label_address0.read() << "\" ";
